import React from 'react';
import { Route, Redirect } from 'react-router-dom';

const PrivateRoute = ({ element, isAuthenticated, ...rest }) => {
  return isAuthenticated ? (
    <Route {...rest} element={element} />
  ) : (
    <Redirect to="/login" />
  );
};

export default PrivateRoute;
